  subroutine phase_scrambling
    real(8)              :: Ntotal             ! 全波数
    integer              :: random_seed_size   ! 乱数の種の長さ
    integer, allocatable :: seedarray(:)       ! 乱数の種
    real                 :: harvest            ! 乱数の値
    real                 :: random_phase(-lm:lm,-km:km)
    integer              :: i_count(1:wn)

    integer    :: Seed=0           ! seed(1)に設定する種の値
    real(8)    :: Nmin=0.0D0       ! 初期エネルギー分布の全波数領域域最小値
    real(8)    :: Nmax=21.0D0      ! 初期エネルギー分布の全波数領域最大値
    real(8)    :: Etotal=1.0D0     ! 初期平均エネルギーの値
    
    namelist /initvalue/ Seed, Nmin, Nmax, Etotal

    real(8), allocatable :: et_Strfunc_tmp(:,:)
    allocate(et_Strfunc_tmp(-lm:lm,-km:km))

    ! ---- 乱数設定
    call random_seed(size=random_seed_size)
    allocate(seedarray(random_seed_size))
    call random_seed(get=seedarray)
    seedarray(1)=Seed
    call random_seed(put=seedarray)
    
    do k=-km,km
       do l=-lm,lm
             call random_number(harvest)
             random_phase(l,k)= harvest            ! [0,1] の一様乱数
       enddo
    enddo
  
    ! ---- Phase scrumbling
    et_Strfunc_tmp = 0.0D0
    et_Strfunc = et_LaplaInv_et(et_Vor)
    
    k=0
       do l=1,lm
             et_Strfunc_tmp(l,k) = et_Strfunc(l,k) * cos(2.0*pi*random_phase(l,k)) &
                                  & + et_Strfunc(-l,k) * sin(2.0*pi*random_phase(l,k))
             et_Strfunc_tmp(-l,k) = et_Strfunc(l,k) * sin(2.0*pi*random_phase(l,k)) &
                                  & - et_Strfunc(-l,k) * cos(2.0*pi*random_phase(l,k))
       enddo

    do k=1,km
       do l=-lm,lm
             et_Strfunc_tmp(l,k) = et_Strfunc(l,k) * cos(2.0*pi*random_phase(l,k)) &
