             et_Strfunc_tmp(l,-k) = et_Strfunc(l,k) * sin(2.0*pi*random_phase(l,k)) &
                                  & + et_Strfunc(l,-k) * cos(2.0*pi*random_phase(l,k))
       enddo
    enddo
    
    et_Strfunc = et_Strfunc_tmp    
    et_Vor = et_Lapla_et(et_Strfunc)

